funcExec:
function funcExec() {
  log("funcExec");
  const tag = localStorage.getItem("TZ_EXEC");
  if (tag && new Date().getTime() - tag < 1000 * 5) return;
  localStorage.setItem("TZ_EXEC", new Date().getTime());
  people.value = "4";
  change(); 
  document.getElementsByClassName("btn_OK")[0].click();
  setTimeout(funcEnd, 1000);
}

